INSERT INTO `v1_9c7b84f7b9ab2cde76972cb48c8c9f99acf1e4d671821443cdf0f34db021f645` VALUES (5, 3.1, 130301, 1, 10013, "2024/06/22 14:59:59", 4, "2024/03/15 15:00:00", 2002, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", "カノン", 3, -470.0, 0.0);
